    false,nt"url": null,nt"notes": "This narrative report for Pea Island NWR
    outlines Refuge accomplishments from January through April of 1954. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, furbearers, and predators- is
    also covered. The Refuge development and maintenance section discusses physical
    developments and prescribed burning. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    recreational uses and Refuge visitors. N-R forms are attached.",nt"owner_org":
